import React from "react";
import {Box, Btn} from "../UI"
import {lista} from "../../info"
import Card from "../Card";

const List = () => {
    return <Box>
        {
            lista.cargos.map( ({id, type, value, from, date}) => {
               return <Card key={id} />
            })
        }
        <Btn>Ver mas</Btn>
    </Box>
}

export default List
